import React from 'react'

export default function PatientsCount() {

        const stats = [
            { title: "Patients Served", value: "25,356" },
            { title: "Consultations this week", value: "6,050" },
            { title: "Locations", value: "21" },
            { title: "Success Rate", value: "95%" },
          ];
        
          return (
            <section className="w-full top-[60px] max-w-[1440px] mx-auto bg-[#f8f8f8] py-12 px-4 flex flex-col items-center">
              {/* Main heading */}
              <h2 className="text-center max-w-[701px] text-[#444444] text-4xl md:text-5xl font-medium leading-tight mb-4">
                Our Stats show that weâ€™ve Happy Patients
              </h2>
              {/* Subheading */}
              <p className="text-center max-w-[618px] text-[#878787] text-lg leading-6 mb-12">
                And excellence partiality estimating terminated day everything.
              </p>
              {/* Stats cards */}
              <div className="flex flex-wrap justify-center gap-8">
                {stats.map((stat, index) => (
                  <div
                    key={index}
                    className="w-[264px] h-[207px] flex flex-col items-center justify-center bg-white rounded-lg shadow-lg p-6"
                  >
                    <div className="text-[#444444] text-5xl font-medium leading-tight mb-2">{stat.value}</div>
                    <div className="text-[#878787] text-lg text-center">{stat.title}</div>
                  </div>
                ))}
              </div>
            </section>
          );
        };
